export default class MobileMenu extends Component {
    render() {
        return (
            <div id="mvp-fly-wrap">
                <div className="fky-menu-mobile">
            <nav>
                <ul>
                    <li>
                        <a>Feature</a>
                    </li>
                    <li>
                        <a>Scores</a>
                    </li>
                </ul>
            </nav>
                </div>
            </div>

        )
    }
}
